// 迭代对象的方法：for/in:获取所有的keys,然后迭代keys;也可以使用for/of(但是需要字节为其设置)
let obj={
  name:'zhufeng',
  age:13,
  0:100,
  [Symbol('AA')]:200
}

Object.prototype[Symbol.iterator]=function iterator(){
  let self=this,//迭代的对象
  index=-1,
  keys=Reflect.ownKeys(self)
}
